#include <iostream>
#include <cmath>

using namespace std;

int main() {
    int days;
    cin >> days;

    double availableFoodInKg, dogFoodPerDayInKg, catFoodPerDayInKg, turtleFoodPerDayInGrams;
    cin >> availableFoodInKg >> dogFoodPerDayInKg >> catFoodPerDayInKg >> turtleFoodPerDayInGrams;

    availableFoodInKg -= (dogFoodPerDayInKg + catFoodPerDayInKg + turtleFoodPerDayInGrams / 1000) * days;

    if (availableFoodInKg >= 0) {
        cout << floor(availableFoodInKg) << " kilos of food left." << endl;
    }
    else {
        cout << ceil(abs(availableFoodInKg)) << " more kilos of food are needed." << endl;
    }

    return 0;
}

#include <iostream>
#include <algorithm>
using namespace std;

int main(){
    int n,x,ans=0,l,r;
    cin >>n >>x;
    int a[n];
    for (int i=0;i<n;i++){
        cin >>a[i];
    }
    sort(a, a + n);
    l=0;
    r=n-1;
    while (l<r){
        if ((a[r]+a[l])>x){
            ans++;
            r--;
        } else {
            ans++;
            l++;
            r--;
        }
        if (l==r){
            ans++;
        }
    }
    cout <<ans<<"\n";
    return 0;
}
